import React from "react";
import { useState } from "react";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

const NewExpense = (props) => {
  const [showFormNewExpense, setshowFromNewExpense] = useState(false);

  const saveExpenseDataHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    props.onAddExpense(expenseData);
  };

  return (
    <>
      showFormNewExpense? (
      <button onClick={setshowFromNewExpense(true)}>Add New Expense</button>) :
      (
      <div className="new-expense">
        <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} canselShow = {setshowFromNewExpense}/>
      </div>
      )
    </>
  );
};

export default NewExpense;
